description:
And another scanlation from Alice, Belladonna.

1680.  An attempt is made on the life of the Sun King, Louis XIV, but its thwarted by an angel. She works for a secret order of the Musketeers led by an old hero, long presumed dead. Her name is Marie. Her codename is Belladonna.
